class SvgConverter():
    EOF = "eof"
    DIGITS = "1234567890"

    def __init__(self, svg):
        self.svg = svg
        self.cur_index = 0
        self.output = []

    def convert(self):
        while True:
            c = self.process_current_char()
            if c == self.EOF:
                return "".join(self.output)
            self.output.append(c)
            self.advance()

    def peek(self):
        next_index = self.cur_index + 1
        if next_index >= len(self.svg):
            return None
        return self.svg[next_index]

    def prev(self):
        prev_index = self.cur_index - 1
        if prev_index < 0:
            return None
        return self.svg[prev_index]

    def process_current_char(self):
        if self.cur_index >= len(self.svg):
            return self.EOF
        cur_char = self.svg[self.cur_index]
        # m's are capitalized
        if cur_char == "m":
            return "M"
        # separators are removed if next char is not a digit
        if cur_char == " " or cur_char == ",":
            if self.peek() in self.DIGITS and self.prev() != "m":
                return " "
            return ""
        return cur_char

    def advance(self):
        self.cur_index += 1


